Sorting in Flask via Jinja template variable issue when called<p>I have an HTML drop-down form that isn't working, so I just changed it to buttons to test (I am very new to Flask and python in general so I am experimenting).</p>
<p>I am trying to give users the choice to sort posts by time added, names etc. At the moment I am just experimenting with these three and they're in button form (will be in drop-down when I work out how):</p>
<pre><code>&lt;form action=&quot;{{ url_for('filters') }}&quot; name=&quot;sort&quot; method=&quot;POST&quot;&gt;
        &lt;button type=&quot;submit&quot; id=&quot;latest&quot; class=&quot;btn&quot;&gt;Latest&lt;/button&gt;
        &lt;button type=&quot;submit&quot; id=&quot;oldest&quot; class=&quot;btn&quot;&gt;Oldest&lt;/button&gt;
        &lt;button type=&quot;submit&quot; id=&quot;names&quot; class=&quot;btn&quot;&gt;Name&lt;/button&gt;
&lt;/form&gt;
</code></pre>
<p>This is all on a page called: <code>questions.html</code></p>
<p>The filters app is:
@app.route(&quot;/filters&quot;, methods=[&quot;GET&quot;, &quot;POST&quot;])</p>
<pre><code>def filters():
