How to remove dynamic mongodb oid's in logstash?<p>Mongodb has 2 types of <code>$oid</code> reference -</p>
<p>Type 1 -</p>
<pre><code>//MongoDB
city_id : &quot;5fe3206428bf745876649fd3&quot;

//Kafka Message
city_id : {
    &quot;$oid&quot;: &quot;5fe3206428bf745876649fd3&quot;
}
</code></pre>
<p>Type 2 -</p>
<pre><code>//MongoDB
city_ids : [&quot;5fe3206428bf745876649fd3&quot;,&quot;5fe3206428bf745876649fd3&quot;,&quot;5fe3206428bf745876649fd3&quot;]

//Kafka Message
city_ids : [
  {
    &quot;$oid&quot;: &quot;5fe3206428bf745876649fd3&quot;
  },
  {
    &quot;$oid&quot;: &quot;5fe3206428bf745876649fd3&quot;
  },
  {
    &quot;$oid&quot;: &quot;5fe3206428bf745876649fd3&quot;
  }
]
</code></pre>
<p>How can I handle these two types in logstash, such that I get the exact data structure for elasticsearch as it is saved in MongoDB.</p>
<pre><code>input {
  kafka {
        bootstrap_servers =&gt; &quot;localhost:9092&quot;
        decorate_events =&gt; true
        topics =&gt; [&quot;users&quot;,&quot;organisations&quot;,&quot;cities&quot;]
  }
}
filter { 
    json {
        source =&gt; &quot;message&quot;
        target =&gt; &quot;json_payload&quot;
    }

    json {
        source =&gt; &quot;[json_payload][payload]&quot;
        target =&gt; &quot;payload&quot;
    }

    mutate {
        rename =&gt; { &quot;[payload]&quot; =&gt; &quot;document&quot;}
        remove_field =&gt; [&quot;message&quot;,&quot;json_payload&quot;,&quot;payload&quot;]
        add_field =&gt; {
          &quot;[es_index]&quot; =&gt; &quot;%{[@metadata][kafka][topic]}&quot; 
          &quot;[mongo_id]&quot; =&gt; &quot;%{[document][_id][$oid]}&quot;
        }
    }
}
output {
    elasticsearch {
        hosts =&gt; [&quot;localhost:9200&quot;]
        index =&gt; &quot;%{es_index}&quot;
        document_id =&gt; &quot;%{mongo_id}&quot;
    }
    stdout {
      codec =&gt;
        rubydebug {
            metadata =&gt; true
        }
    }
}
</code></pre>
<p>This is a follow through from a previous <a href="https://stackoverflow.com/questions/65404914/how-to-run-the-mongo-kafka-connector-as-a-source-for-kafka-and-integrate-that-wi">question</a>.</p>

